css:
@namespace url(http://www.w3.org/1999/xhtml);
@-moz-document domain(www.linuxdistrocommunity.com){
body {color: #FFFFFF !important;}
input, textarea, select {color: #FFFFFF;background-color: #000000;border-color: #2B2F37;-moz-appearance: none !important;}
SPAN[style='color: #1AAF36;'] {color: #E550C9 !important;}
SPAN[style='color: #2932B8;'] {color: #D6CD47 !important;}
body {background-color: #101010 !important;color: #FFFFFF !important;}
a:link {color: #FD934E !important;}
a:visited {color: #FD934E !important;}
a:hover, a:active {color: #FFFFFF !important;}
#container {background-color: #000000 !important;border-top-color: #1B1B1B !important;border-right-color: #1B1B1B !important;border-bottom-color: #1B1B1B !important;border-left-color: #1B1B1B !important;color: #FFFFFF !important;}
.menu ul {color: #FFFFFF !important;}
.menu ul a:link {color: #FFFFFF !important;}
.menu ul a:visited {color: #FFFFFF !important;}
.menu ul a:hover, .menu ul a:active {color: #B78B5C !important;}
#panel {background-color: #101010 !important;color: #FFFFFF !important;border-top-color: #2B2B2B !important;border-right-color: #2B2B2B !important;border-bottom-color: #2B2B2B !important;border-left-color: #2B2B2B !important;}
table {color: #FFFFFF !important;}
.tborder {background-color: #7E5D3B !important;border-top-color: #F0A371 !important;border-right-color: #F0A371 !important;border-bottom-color: #F0A371 !important;border-left-color: #F0A371 !important;}
.thead {background-color: #FD934E !important;background-image: url("data:image/png;base64,") !important;background-repeat: repeat-x !important;color: #000000 !important;}
.thead a:link {color: #000000 !important;}
.thead a:visited {color: #000000 !important;}
.thead a:hover, .thead a:active {color: #000000 !important;}
.tcat {background-color: #523418 !important;color: #FFFFFF !important;}
.tcat a:link {color: #FFFFFF !important;}
.tcat a:visited {color: #FFFFFF !important;}
.tcat a:hover, .tcat a:active {color: #FFFFFF !important;}
.trow1 {background-color: #0A0A0A !important;}
.trow2 {background-color: #101010 !important;}
.trow_shaded {background-color: #00221F !important;}
.trow_selected td {background-color: #000426 !important;}
.trow_sep {background-color: #1A1A1A !important;color: #FFFFFF !important;}
.tfoot {background-color: #FD934E !important;background-image: url("data:image/png;base64,") !important;background-repeat: repeat-x !important;color: #000000 !important;}
.tfoot a:link {color: #000000 !important;}
.tfoot a:visited {color: #000000 !important;}
.tfoot a:hover, .tfoot a:active {color: #000000 !important;}
.bottommenu {background-color: #101010 !important;color: #FFFFFF !important;border-top-color: #B78B5C !important;border-right-color: #B78B5C !important;border-bottom-color: #B78B5C !important;border-left-color: #B78B5C !important;}
.navigation {color: #FFFFFF !important;}
.navigation .active {color: #FFFFFF !important;}
input.textbox {background-color: #000000 !important;color: #FFFFFF !important;border-top-color: #F0A371 !important;border-right-color: #F0A371 !important;border-bottom-color: #F0A371 !important;border-left-color: #F0A371 !important;}
textarea {background-color: #000000 !important;color: #FFFFFF !important;border-top-color: #F0A371 !important;border-right-color: #F0A371 !important;border-bottom-color: #F0A371 !important;border-left-color: #F0A371 !important;}
select {background-color: #000000 !important;border-top-color: #F0A371 !important;border-right-color: #F0A371 !important;border-bottom-color: #F0A371 !important;border-left-color: #F0A371 !important;}
.editor {background-color: #0E0E0E !important;border-top-color: #333333 !important;border-right-color: #333333 !important;border-bottom-color: #333333 !important;border-left-color: #333333 !important;}
.editor_control_bar {background-color: #000000 !important;border-top-color: #F0A371 !important;border-right-color: #F0A371 !important;border-bottom-color: #F0A371 !important;border-left-color: #F0A371 !important;}
.autocomplete {background-color: #000000 !important;border-top-color: #FFFFFF !important;border-right-color: #FFFFFF !important;border-bottom-color: #FFFFFF !important;border-left-color: #FFFFFF !important;color: #FFFFFF !important;}
.autocomplete_selected {background-color: #523118 !important;color: #FFFFFF !important;}
.popup_menu {background-color: #333333 !important;border-top-color: #FFFFFF !important;border-right-color: #FFFFFF !important;border-bottom-color: #FFFFFF !important;border-left-color: #FFFFFF !important;}
.popup_menu .popup_item {background-color: #000000 !important;color: #FFFFFF !important;}
.popup_menu .popup_item:hover {background-color: #382411 !important;color: #FFFFFF !important;}
.trow_reputation_positive {background-color: #330033 !important;}
.trow_reputation_negative {background-color: #003333 !important;}
.reputation_positive {color: #FF7FFF !important;}
.reputation_neutral {color: #BBBBBB !important;}
.reputation_negative {color: #00FFFF !important;}
.invalid_field {border-top-color: #00CCFF !important;border-right-color: #00CCFF !important;border-bottom-color: #00CCFF !important;border-left-color: #00CCFF !important;color: #00CCFF !important;}
.valid_field {border-top-color: #FF33FF !important;border-right-color: #FF33FF !important;border-bottom-color: #FF33FF !important;border-left-color: #FF33FF !important;}
.validation_error {color: #00CCFF !important;}
.validation_success {color: #FF4DFF !important;}
.validation_loading {color: #AAAAAA !important;}
.selectall {background-color: #000426 !important;}
img.attachment {border-top-color: #161A28 !important;border-right-color: #161A28 !important;border-bottom-color: #161A28 !important;border-left-color: #161A28 !important;}
hr {background-color: #FFFFFF !important;color: #FFFFFF !important;}
blockquote {border-top-color: #333333 !important;border-right-color: #333333 !important;border-bottom-color: #333333 !important;border-left-color: #333333 !important;background-color: #000000 !important;}
blockquote cite {border-bottom-color: #333333 !important;}
.codeblock {background-color: #000000 !important;border-top-color: #333333 !important;border-right-color: #333333 !important;border-bottom-color: #333333 !important;border-left-color: #333333 !important;}
.codeblock .title {border-bottom-color: #333333 !important;}
.highlight {background-color: #000033 !important;}
.pm_alert {background-color: #000940 !important;border-top-color: #002CDB !important;border-right-color: #002CDB !important;border-bottom-color: #002CDB !important;border-left-color: #002CDB !important;}
.red_alert {background-color: #041C1B !important;border-top-color: #5AE9E5 !important;border-right-color: #5AE9E5 !important;border-bottom-color: #5AE9E5 !important;border-left-color: #5AE9E5 !important;color: #5AE9E5 !important;}
.high_warning {color: #33FFFF !important;}
.moderate_warning {color: #0C9EE4 !important;}
.low_warning {color: #51A8FF !important;}
div.error {border-top-color: #002CDB !important;border-bottom-color: #002CDB !important;background-color: #000940 !important;}
div.error p {color: #FFFFFF !important;}
div.error p em {color: #33FFFF !important;}
.online {color: #EA5FE7 !important;}
.offline {color: #383838 !important;}
.pagination a {border-top-color: #7E5D3B !important;border-right-color: #7E5D3B !important;border-bottom-color: #7E5D3B !important;border-left-color: #7E5D3B !important;}
.pagination .pagination_current {background-color: #0A0A0A !important;border-top-color: #7E5D3B !important;border-right-color: #7E5D3B !important;border-bottom-color: #7E5D3B !important;border-left-color: #7E5D3B !important;color: #FFFFFF !important;}
.pagination a:hover {background-color: #0A0A0A !important;}
.success_message {color: #FF4DFF !important;}
.error_message {color: #33FFFF !important;}
._neutral {background-color: #050505 !important;color: #666666 !important;border-top-color: #333333 !important;border-right-color: #333333 !important;border-bottom-color: #333333 !important;border-left-color: #333333 !important;}
._minus {background-color: #022D2E !important;color: #34FDFF !important;border-top-color: #67FDFE !important;border-right-color: #67FDFE !important;border-bottom-color: #67FDFE !important;border-left-color: #67FDFE !important;}
._plus {background-color: #170323 !important;color: #FF77FF !important;border-top-color: #FF77FF !important;border-right-color: #FF77FF !important;border-bottom-color: #FF77FF !important;border-left-color: #FF77FF !important;}
.pagination_breadcrumb {background-color: #0A0A0A !important;border-top-color: #000000 !important;border-right-color: #000000 !important;border-bottom-color: #000000 !important;border-left-color: #000000 !important;outline-color: #333333 !important;}
img[src^="http://www.linuxdistrocommunity.com/forums/images/logo.gif"] {background-image: url("data:image/png;base64,") !important;background-repeat: no-repeat !important;width: 0px !important;padding-right: 420px !important;height: 0px !important;padding-bottom: 100px !important;}

}
